paramConversion.applyStepsToNormalizedParameterValue:
function applyStepsToNormalizedParameterValue(normalizedValue, steps) {
    if (steps == 1) {
        if (normalizedValue > 0) {
            normalizedValue = 1.;
        }
    } else {
        let oneStep = 1. / (steps - 1);
        let numberOfSteps = rnbo_fround(normalizedValue / oneStep * 1 / 1) * 1;
        normalizedValue = numberOfSteps * oneStep;
    }

    return normalizedValue;
}

paramConversion.convertToNormalizedParameterValue:
function convertToNormalizedParameterValue(index, value) {
    switch (index) {
    case 2:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));
            let normalizedValue = (value - 0) / (1 - 0);
            return normalizedValue;
        }
    case 0:
        {
            value = (value < 0 ? 0 : (value > 7 ? 7 : value));
            let normalizedValue = (value - 0) / (7 - 0);
            return normalizedValue;
        }
    case 4:
        {
            value = (value < 0 ? 0 : (value > 12 ? 12 : value));
            let normalizedValue = (value - 0) / (12 - 0);
            return normalizedValue;
        }
    case 3:
        {
            value = (value < 0 ? 0 : (value > 0.95 ? 0.95 : value));
            let normalizedValue = (value - 0) / (0.95 - 0);
            return normalizedValue;
        }
    case 1:
        {
            value = (value < 50 ? 50 : (value > 500 ? 500 : value));
            let normalizedValue = (value - 50) / (500 - 50);
            return normalizedValue;
        }
    case 5:
        {
            value = (value < 50 ? 50 : (value > 500 ? 500 : value));
            let normalizedValue = (value - 50) / (500 - 50);

            {
                if (normalizedValue != 0.0) {
                    normalizedValue = rnbo_exp(
                        rnbo_log((normalizedValue <= 0.0000000001 ? 0.0000000001 : normalizedValue)) * 1. / 2
                    );
                }
            }

            return normalizedValue;
        }
    case 6:
        {
            value = (value < 400 ? 400 : (value > 4000 ? 4000 : value));
            let normalizedValue = (value - 400) / (4000 - 400);

            {
                if (normalizedValue != 0.0) {
                    normalizedValue = rnbo_exp(
                        rnbo_log((normalizedValue <= 0.0000000001 ? 0.0000000001 : normalizedValue)) * 1. / 2
                    );
                }
            }

            return normalizedValue;
        }
    default:
        return value;
    }
}

paramConversion.convertFromNormalizedParameterValue:
function convertFromNormalizedParameterValue(index, value) {
    value = (value < 0 ? 0 : (value > 1 ? 1 : value));

    switch (index) {
    case 2:
        {
            {
                return 0 + value * (1 - 0);
            }
        }
    case 0:
        {
            {
                return 0 + value * (7 - 0);
            }
        }
    case 4:
        {
            {
                return 0 + value * (12 - 0);
            }
        }
    case 3:
        {
            {
                return 0 + value * (0.95 - 0);
            }
        }
    case 1:
        {
            {
                return 50 + value * (500 - 50);
            }
        }
    case 5:
        {
            {
                if (value == 0.0) {
                    return 50;
                } else {
                    return 50 + rnbo_exp(rnbo_log((value <= 0.0000000001 ? 0.0000000001 : value)) * 2) * (500 - 50);
                }
            }
        }
    case 6:
        {
            {
                if (value == 0.0) {
                    return 400;
                } else {
                    return 400 + rnbo_exp(rnbo_log((value <= 0.0000000001 ? 0.0000000001 : value)) * 2) * (4000 - 400);
                }
            }
        }
    default:
        return value;
    }
}

paramConversion.constrainParameterValue:
function constrainParameterValue(index, value) {
    var v = value;

    switch (index) {
    case 0:
        {
            v = (v > 7 ? 7 : (v < 0 ? 0 : v));
            return v;
        }
    case 1:
        {
            v = (v > 500 ? 500 : (v < 50 ? 50 : v));
            return v;
        }
    case 2:
        {
            v = (v > 1 ? 1 : (v < 0 ? 0 : v));
            return v;
        }
    default:
        return value;
    }
}
